from utils.utils import *
import pytest
import sys
import numpy
import base64
from io import BytesIO

@pytest.fixture
def base64_img_str_jpeg():
    return ""


@pytest.fixture
def base64_img_str_png():
    return ""


@pytest.fixture
def img_arr():
    return None


def test_base64_to_cv2_image_jpeg(base64_img_str_jpeg):
    img_arr = base64_to_cv2_image(base64_img_str_jpeg)
    assert img_arr.shape == (612, 459, 3)


def test_base64_to_cv2_image_png(base64_img_str_png):
    img_arr = base64_to_cv2_image(base64_img_str_png)
    assert img_arr.shape == (404, 310, 3)
    


def test_base64_to_cv2_image_empty():
    with pytest.raises(Exception) as f:
        img_arr = base64_to_cv2_image("")


def test_cv2_image_to_base64(base64_img_str_jpeg):
    img_arr = base64_to_cv2_image(base64_img_str_jpeg)
    img_str = cv2_image_to_base64(img_arr)
    assert sys.getsizeof(img_str) == 42889


def test_bytes_to_cv2_image_jpeg(base64_img_str_jpeg):
    img_bytes = BytesIO(base64.b64decode(base64_img_str_jpeg))
    img_arr = bytes_to_cv2_image(img_bytes)
    assert img_arr.shape == (612, 459, 3)


def test_bytes_to_cv2_image_jpeg(base64_img_str_png):
    img_bytes = BytesIO(base64.b64decode(base64_img_str_png))
    img_arr = bytes_to_cv2_image(img_bytes)
    assert img_arr.shape == (404, 310, 3)